import './phoneLeft.scss';
import { useState } from 'react';

interface PhoneLeftProps {
    classNameAdded: string;
    elements: JSX.Element;
}

const PhoneLeft = ({ classNameAdded = '', elements = <></> }: PhoneLeftProps): JSX.Element => {

    const [active, setActive] = useState<boolean>(false);

    return (
        <div className={`phoneLeft ${classNameAdded} ${active ? "phoneLeft--active" : ""}`} onMouseEnter={() => setActive(true)}>
            <div className="phoneLeft__base">
                <div className="phoneLeft__base__screen">
                    <div className="phoneLeft__base__camera-top">
                    </div>
                    <div className="phoneLeft__base__microphone">
                    </div>
                    <div className="phoneLeft__base__message">
                        {elements}
                    </div>
                </div>
                <div className="phoneLeft__base__charger">
                </div>
                <div className="phoneLeft__base__volume-1">
                </div>
                <div className="phoneLeft__base__volume-2">
                </div>
            </div>
        </div>
    );
}

export default PhoneLeft;
